('001', '1', 'Livro', ' Informática', 'Conceitos Básicos', , 'Português', '9', '1', 'Elsevier', 'Fernando de Castro Velloso', '408', '2014', 'Brasil', 'Cobrindo desde hardware até linguagens de programação, passando por redes de computadores, funcionamento da memória, sistemas operacionais, lógica de programação, tecnologia da informação e Internet, este livro é referência básica para estudantes que precisam conhecer melhor as bases dos atuais sistemas computacionais. A didática do autor, aperfeiçoada ao longo dessas nove edições, permite que todos os interessados compreendam os conceitos mais abstratos de informática. ', '9788535277906', '24cm x 17cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('002', '1', 'Livro', 'Use a Cabeça!', 'JAVA', , 'Português', '2', '1', 'Starlin ALTA', 'Kathy Sierra', '470', '2016', 'Brasil', '''Use a cabeça! - Java'' é uma experiência de aprendizado em programação orientada a objetos (OO) e Java. Projetado de acordo com princípios de aprendizado mentalmente amigáveis, este livro procura mostrar desde aspectos considerados básicos da linguagem a tópicos avançados que incluem segmentos, soquetes de rede e programação distribuída. Alguns conteúdos - A linguagem Java; Desenvolvimento orientado a objetos; Criação, teste e implantação de aplicativos; Uso da biblioteca do API Java; Manipulação de exceções; Uso de vários segmentos; Programação de GUI com o Swing; Rede com RMI e soquetes; Conjuntos e tipos genéricos.', '8576081733', '28cm x 21cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('003', '2', 'Livro', 'Geração de Valor', 'Compartilhando Inspiração', , 'Português', '1', '1', 'Sextante', 'Flávio Augusto da Silva', '208', '2014', 'Brasil', 'Desde que nascem, as pessoas são treinadas para agir de acordo com o senso comum. O ensino convencional as estimula a buscar segurança, e não liberdade. Com medo de se arriscar, a maioria segue o fluxo da boiada e sonha pequeno, optando por conseguir um emprego estável e passar anos financiando a casa própria. Flávio Augusto também sofreu todas essas pressões, mas conseguiu sair da conformidade bem cedo. De uma família simples da periferia do Rio de Janeiro, aos 23 anos, escolheu o caminho do empreendedorismo, criou uma escola de inglês que deu origem à bem-sucedida rede Wise Up e logo se tornou um dos mais jovens bilionários brasileiros. Indignado com o modelo imposto pelo senso comum, Flávio resolveu arregaçar as mangas e mostrar às pessoas que é possível pensar de forma diferente. Para difundir sua mentalidade vitoriosa, criou o projeto Geração de Valor e começou a compartilhar seus conhecimentos no Facebook, no YouTube, no Twitter e em um blog, inspirando milhões de pessoas.', '854310162X', '23cm x 16cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('004', '3', 'Livro', 'Gerenciamento da Cadeia de Suprimentos', 'Logística Empresarial', , 'Português', '5', '1', 'Bookman', 'Ronald Ballou', '616', '2005', 'Brasil', 'Esta edição apresenta os aspectos operacionais, táticos e estratégicos da cadeia de suprimentos/logística empresarial. A obra traz os seguintes temas - logística empresarial/cadeia de suprimentos; estratégia e planejamento da logística/cadeia de suprimentos; o produto da cadeia de suprimentos/logística; logística/cadeia de suprimentos - serviço ao cliente; processamento de pedidos e sistemas de informação; fundamentos do transporte; decisão sobre transportes; necessidades de previsão da cadeia de suprimentos; decisões sobre política de estoques; decisões de compras de programação de dos suprimentos; o sistema de estocagem e manuseio; decisões de estocagem e manuseio; decisões de localização das instalações; o processo de planejamento da rede; organização da cadeia de suprimentos/logística; controle da cadeia de suprimentos/logística.', '8536305916', '28cm x 21cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('005', '1', 'Livro', 'Web Design Responsivo', 'Aprenda a Criar Sites Que Se Adaptam Automaticamente a Qualquer Dispositivo, Desde Desktops Até Telefones Celulares', , 'Português', '1', '1', 'Novatec', 'Mauricio Samy Silva', '336', '2014', 'Brasil', 'Este livro foi escrito para pessoas envolvidas na criação de sites tanto na área de design quanto na de desenvolvimento e programação, que desejam criar interfaces usáveis e acessíveis em qualquer dispositivo independentemente de suas características, isto é, que se adaptem às mais variadas resoluções de tela. O objetivo do livro é fornecer informações detalhadas das técnicas do design responsivo, estudando seus princípios e detalhando os métodos e as tecnologias aplicáveis. Explicações teóricas em linguagem corrente e clara, dispensando, sempre que possível, o jargão técnico avançado, são acompanhadas de exemplos práticos detalhados passo a passo e complementados por arquivo HTML para consulta. Os conceitos e o entendimento das técnicas de desenvolvimento de interfaces responsivas são uma poderosa ferramenta de apoio na criação de sites mais acessíveis, enriquecendo a experiência do usuário. Profissionais da área de design, familiarizados com as técnicas aqui descritas.', '8575223925', '23cm x 17cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('006', '4', 'Livro', 'O Príncipe', '', , 'Portugues', '1', '1', 'Edipro De Bolso', 'Nicolau Maquiavel', '232', '', '', 'Àqueles que chegam desavisados ao texto límpido e elegante de Nicolau Maquiavel pode parecer que o autor escreveu, na Florença do século XVI, um manual abstrato para a conduta de um mandatário. Entretanto, esta obra clássica da filosofia moderna, fundadora da ciência política, é fruto da época em que foi concebida. solução do governo republicano de Florença e do retorno da família Médici ao poder, Maquiavel é preso, acusado de conspiração. Perdoado pelo papa Leão X, ele se exila e passa a escrever suas grandes obras. O príncipe, publicado postumamente, em 1532, é uma esplêndida meditação sobre a conduta do governante e sobre o funcionamento do Estado, produzida num momento da história ocidental em que o direito ao poder já não depende apenas da hereditariedade e dos laços de sangue. Mais que um tratado sobre as condições concretas do jogo político, O príncipe é um estudo sobre as oportunidades oferecidas pela fortuna, sobre as virtudes e os vícios intrínsecos ao comportamento dos governantes, com sugestões sobre moralidade, ética e organização urbana que, apesar da inspiração histórica, permanecem espantosamente atuais.', '9788578272555', '21 cm x 14 cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('007', '4', 'Livro', 'O Mundo de Sofia', '', , 'Portugues', '1', '1', 'Cia Das Letras', 'Jostein Gaarder', '568', '1995', '', 'Às vésperas de seu aniversário de quinze anos, Sofia Amundsen começa a receber bilhetes e cartões-postais bastante estranhos. Os bilhetes são anônimos e perguntam a Sofia quem é ela e de onde vem o mundo. Os postais são enviados do Líbano, por um major desconhecido, para uma certa Hilde Moller Knag, garota a quem Sofia também não conhece. O mistério dos bilhetes e dos postais é o ponto de partida deste romance. De capítulo em capítulo, de ´lição´ em ´lição´, o leitor é convidado a percorrer toda a história da filosofia ocidental, ao mesmo tempo que se vê envolvido por um thriller. O livro é traduzido diretamente do norueguês.', '9788535921892', '21 cm x 14 cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('008', '5', 'Livro', 'A Menina que Roubava Livros', '', , 'Portugues', '1', '1', 'Intriseca', 'Markus Zusak', '480', '2005', 'Brasil', 'A trajetória de Liesel Meminger é contada por uma narradora mórbida, porém surpreendentemente simpática. Ao perceber que a pequena ladra de livros lhe escapa, a Morte afeiçoa-se à menina e rastreia suas pegadas de 1939 a 1943. Traços de uma sobrevivente: a mãe comunista, perseguida pelo nazismo, envia Liesel e o irmão para o subúrbio pobre de uma cidade alemã, onde um casal se dispõe a adotá-los em troca de dinheiro. O garoto morre no trajeto e é enterrado por um coveiro que deixa cair um livro na neve. É o primeiro de uma série que a menina vai surrupiar ao longo dos anos. Essa obra, que ela ainda não sabe ler, é seu único vínculo com a família.\r\nAssombrada por pesadelos, ela compensa o medo e a solidão das noites com a cumplicidade do pai adotivo, um pintor de parede bonachão que a ensina a ler. Em tempos de livros incendiados, o gosto de roubá-los deu à menina uma alcunha e uma ocupação; a sede de conhecimento deu-lhe um propósito.\r\nA vida na rua Himmel é a pseudorrealidade criada em torno do culto a Hitler na Segunda Guerra. Ela assiste à eufórica celebração do aniversário do Führer pela vizinhança. Teme a dona da loja da esquina, colaboradora do Terceiro Reich. Faz amizade com um garoto obrigado a integrar a Juventude Hitlerista. E ajuda o pai a esconder no porão um jovem judeu que escreve livros artesanais para contar a sua parte naquela história. A Morte, perplexa diante da violência humana, dá um tom leve e divertido à narrativa desse duro confronto entre a infância perdida e a crueldade do mundo adulto, um sucesso absoluto — e raro — de crítica e público. ', '9788580574517', '21 cm x 14 cm', NULL);
INSERT INTO `acervo` (`cod_acervo`, `cod_classificacao`, `tipo_material`, `titulo`, `subtitulo`, `imagem`, `idioma`, `edicao`, `volume`, `editora`, `nome_autor`, `num_paginas`, `ano_publicacao`, `local_publicacao`, `resumo`, `isbn`, `dimensoes`, `ativo`) VALUES
('009', '5', 'Livro', 'As Vantagens de Ser Invisivel', '', NULL, 'Portugues', '1', '1', 'Rocco', 'Stephen Chbosky', '223', '2007', 'Brasil', 'Cartas mais íntimas que um diário, estranhamente únicas, hilárias e devastadoras - são apenas através delas que Charlie compartilha todo o seu mundinho com o leitor. Enveredando pelo universo dos primeiros encontros, dramas familiares, novos amigos, sexo, drogas e daquela música perfeita que nos faz sentir infinito, o roteirista Stephen Chbosky lança luz sobre o amadurecimento no ambiente da escola, um local por vezes opressor e sinônimo de ameaça. Uma leitura que deixa visível os problemas e crises próprios da juventude. ', '9788532522337', '21 cm x 14 cm', NULL);

